import org.junit.jupiter.api.Test;

import java.text.MessageFormat;
import java.time.Duration;
import java.time.Instant;
import java.util.function.Function;

public class FindFirstNonRepeatingCharacterTest {

    @Test
    public void test() {
        FindFirstNonRepeatingCharacter sut = new FindFirstNonRepeatingCharacter();

        String input1 = "aaabcccdeeef";
        String input2 = "abcbad";
        String input3 = "abcabcabc";
        String input4 = "";

        measureTime(sut::findFirstNonRepeatingCharacterWithMap, input1);
        measureTime(sut::findFirstNonRepeatingCharacterWithMap, input2);
        measureTime(sut::findFirstNonRepeatingCharacterWithMap, input3);
        measureTime(sut::findFirstNonRepeatingCharacterWithMap, input4);

        System.out.println("----" );

        measureTime(sut::findFirstNonRepeatingCharacterWithPointers, input1);
        measureTime(sut::findFirstNonRepeatingCharacterWithPointers, input2);
        measureTime(sut::findFirstNonRepeatingCharacterWithPointers, input3);
        measureTime(sut::findFirstNonRepeatingCharacterWithPointers, input4);
    }

    private Character measureTime(Function<String, Character> function, String argument) {
        Instant start = Instant.now();
        Character result = function.apply(argument);
        Instant finish = Instant.now();
        String msg = MessageFormat.format("Input: {0} \n Time: {1}", argument, Duration.between(start, finish).toMillis());
        System.out.println(msg);
        return result;
    }
}
